BrawSimResults <- if (requireNamespace("jmvcore", quietly=TRUE)) R6::R6Class(
    "BrawSimResults",
    inherit = jmvcore::Group,
    active = list(
        BrawStatsInstructions = function() private$.items[["BrawStatsInstructions"]],
        SystemHTML = function() private$.items[["SystemHTML"]],
        simGraphHTML = function() private$.items[["simGraphHTML"]],
        simGraph = function() private$.items[["simGraph"]],
        simReport = function() private$.items[["simReport"]],
        debug = function() private$.items[["debug"]],
        sendSample = function() private$.items[["sendSample"]],
        sendMultiple = function() private$.items[["sendMultiple"]]),
    private = list(),
    public=list(
        initialize=function(options) {
            super$initialize(
                options=options,
                name="",
                title="BrawStats:Simulate Data",
                refs="brawstats book")
            self$add(jmvcore::Html$new(
                options=options,
                name="BrawStatsInstructions",
                visible=TRUE))
            self$add(jmvcore::Html$new(
                options=options,
                name="SystemHTML",
                visible=FALSE))
            self$add(jmvcore::Html$new(
                options=options,
                name="simGraphHTML",
                visible=FALSE))
            self$add(jmvcore::Image$new(
                options=options,
                name="simGraph",
                title=" ",
                width=550,
                height=400,
                visible=TRUE,
                renderFun=".plotSimGraph",
                clearWith=list(
                    "showHypothesisBtn",
                    "makeSampleBtn",
                    "showSampleType",
                    "showInferParam",
                    "inferVar1",
                    "inferVar2",
                    "showInferDimension",
                    "makeMultipleBtn",
                    "showMultipleParam",
                    "showMultipleDimension",
                    "makeExploreBtn",
                    "showExploreParam",
                    "showExploreDimension",
                    "whichShowMultiple")))
            self$add(jmvcore::Html$new(
                options=options,
                name="simReport",
                visible=TRUE,
                clearWith=list(
                    "showHypothesisBtn",
                    "makeSampleBtn",
                    "showSampleType",
                    "showInferParam",
                    "singleVar1",
                    "singleVar2",
                    "showInferDimension",
                    "makeMultipleBtn",
                    "showMultipleParam",
                    "multipleVar1",
                    "multipleVar2",
                    "showMultipleDimension",
                    "reportMultipleStats",
                    "makeExploreBtn",
                    "showExploreParam",
                    "exploreVar1",
                    "exploreVar2",
                    "showExploreDimension",
                    "reportExploreStats",
                    "whichShowMultiple")))
            self$add(jmvcore::Preformatted$new(
                options=options,
                name="debug",
                visible=FALSE))
            self$add(jmvcore::Output$new(
                options=options,
                name="sendSample",
                measureType="nominal",
                varTitle="Sample",
                items=4,
                clearWith=list(
                    "makeSampleBtn")))
            self$add(jmvcore::Output$new(
                options=options,
                name="sendMultiple",
                measureType="continuous",
                varTitle="Mult",
                items=4,
                clearWith=list(
                    "makeMultipleBtn")))}))

